import React from 'react';
import { 
  AppBar, 
  Toolbar, 
  Typography, 
  Button, 
  styled
} from '@mui/material';
import { Link } from 'react-router-dom';
import FlightTakeoffIcon from '@mui/icons-material/FlightTakeoff';

const StyledTitle = styled(Typography)(({ theme }) => ({
  flexGrow: 1,
  display: 'flex',
  alignItems: 'center',
  color: 'white',
  textDecoration: 'none',
  '& svg': {
    marginRight: theme.spacing(1),
  },
}));

const StyledButton = styled(Button)(({ theme }) => ({
  color: 'white',
  marginLeft: theme.spacing(2),
}));

function Navbar() {
  return (
    <AppBar position="static">
      <Toolbar>
        <StyledTitle variant="h6" component={Link} to="/">
          <FlightTakeoffIcon />
          Travel Planner
        </StyledTitle>
        <StyledButton component={Link} to="/search">
          Search
        </StyledButton>
        <StyledButton component={Link} to="/itinerary">
          My Trips
        </StyledButton>
        <StyledButton component={Link} to="/profile">
          Profile
        </StyledButton>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
